import './App.css';

// Components
import Cover from './Cover';

import Login from './Login';
import Forum from './Forum';
import Contact from './Contact';

class App extends Component {
  render() {
    return (
      <div className="App">
        <div type='container'>
        <Cover />
        <Login />
       <Forum />
       <Contact />
      </div>

      </div>
    )
  }
}

export default App;
